Welcome to DM13 (Dynasty Manager 2013) 
Here is your chance to build your very own Basketball Dynasty. Start from the ground up, Select your home City, signing free agents, trading players, and making upgrades and write your name in Basketball history OR start as one of 30 pre-existing teams. At the end of the year pick up a star in the Draft find him a place in your team and watch him grow over the seasons. Assign player roles, line-ups, and keep your franchise players happy with a lot of playing time. View season statistics and playoff statistics and keep track of your players that are playing well. Use your coaching skills by setting defences and double teams on dominant players or free up your star player by matching him up against a bad defender.
Time to show why you are the next #1 Dynasty Manager.
*Edit Player Ratings. 
*Edit Player Positions. 
*Improve button hit areas 
*Sort Free Agents via skill or Position. 
*Trade including salary, stats, etc. 
*Include funds in trade. Sweeten deal with funds 
*Include Draft Picks in trades. 1st or 2nd round (Max of 4). 
*Possible now to Sim only one Game and return to menu 
*Allow schedules to be viewed and previous scores to be seen. 
*Franchise Stats win/loss, avg attendance for each year. 
*Include Player Stats on Player Info. 
*Injuries Added 
*All Star weekend game and player boosts.

